import React from 'react'

class App extends React.Component{
  constructor() {
    super()
    this.state = {hello: true}
  }

  clickme() {
    this.setState({hello: !this.state.hello})
  }

  render() {
    return <div>
      <div>{this.state.hello ? 'Hello!' : 'Bye!'}</div>
      <button onClick={this.clickme.bind(this)}>Click</button>
    </div>
  }
}

export default App;
